// App.tsx

import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import ProfessorList from './components/ProfessorList';
import AddProfessor from './components/AddProfessor';
import EditProfessor from './components/EditProfessor';
import { Provider as PaperProvider } from 'react-native-paper';

export type RootStackParamList = {
  ProfessorList: undefined;
  AddProfessor: undefined;
  EditProfessor: { professor: Docente };
};

// Definição do tipo Docente
export interface Docente {
  ID_Docente: number;
  Nome: string;
  carga_horaria: number;
  ordem: number;
  is_deleted: boolean;
  created_at: string;
  updated_at: string;
}

const Stack = createStackNavigator<RootStackParamList>();

const App = () => {
  return (
    <PaperProvider>
      <NavigationContainer>
        <Stack.Navigator initialRouteName="ProfessorList">
          <Stack.Screen
            name="ProfessorList"
            component={ProfessorList}
            options={{ title: 'Professores' }}
          />
          <Stack.Screen
            name="AddProfessor"
            component={AddProfessor}
            options={{ title: 'Adicionar Professor' }}
          />
          <Stack.Screen
            name="EditProfessor"
            component={EditProfessor}
            options={{ title: 'Editar Professor' }}
          />
        </Stack.Navigator>
      </NavigationContainer>
    </PaperProvider>
  );
};

export default App;
